canonical_solution:
class Solution:
    def findErrorNums(self, nums: List[int]) -> List[int]:
        xs = 0
        for i, x in enumerate(nums, 1):
            xs ^= i ^ x
        a = 0
        lb = xs & -xs
        for i, x in enumerate(nums, 1):
            if i & lb:
                a ^= i
            if x & lb:
                a ^= x
        b = xs ^ a
        for x in nums:
            if x == a:
                return [a, b]
        return [b, a]

inefficient_solution:
class Solution:
    def findErrorNums(self, nums: List[int]) -> List[int]:
        num_dict = {}
        for num in nums:
            if num in num_dict:
                num_dict[num] += 1
            else:
                num_dict[num] = 1

        missing_num = 1
        duplicate_num = None
        for i in range(1, len(nums) + 1):
            if i not in num_dict:
                missing_num = i
            elif num_dict[i] > 1:
                duplicate_num = i

        return [duplicate_num, missing_num]
